import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 10.1-413 James State Scenic River.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/10.1-413.md","filePath":"vacode/10.1-413.md"}'),i={name:"vacode/10.1-413.md"},n=t('<h1 id="§-10-1-413-james-state-scenic-river" tabindex="-1">§ 10.1-413 James State Scenic River. <a class="header-anchor" href="#§-10-1-413-james-state-scenic-river" aria-label="Permalink to &quot;§ 10.1-413 James State Scenic River.&quot;">​</a></h1><p>The James River in Botetourt and Rockbridge Counties, including the Towns of Buchanan and Glasgow, from its origination at the confluence of the Jackson and Cowpasture Rivers running approximately 59 miles southeastward to the Rockbridge-Amherst-Bedford County line and the James River in Nelson, Appomattox, Albemarle, Buckingham, and Fluvanna Counties from the confluence of Allens Creek running approximately 57 miles to Stearnes are hereby designated as the James State Scenic River, components of the Virginia Scenic Rivers System.</p><p>1985, c. 501, § 10-173.9; 1988, c. 891; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0240" target="_blank" rel="noreferrer">240</a>; 2017, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0149" target="_blank" rel="noreferrer">149</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0549" target="_blank" rel="noreferrer">549</a>; 2018, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0273" target="_blank" rel="noreferrer">273</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0319" target="_blank" rel="noreferrer">319</a>; 2022, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0175" target="_blank" rel="noreferrer">175</a>.</p>',3),o=[n];function c(s,l,g,h,f,p){return a(),r("div",null,o)}const m=e(i,[["render",c]]);export{d as __pageData,m as default};
